import React from 'react'

class AllBooks extends React.Component {
    render() {
        return (
                <div style = {booksStyle} className = "all-books">
                    <h4>{books.title}</h4>
                    <p>Authors: {books.author}</p>

                    <img src = {books.image} alt = "book" />
                </div>




    )
    }

}


const booksStyle = {
    border: "1px solid black",
    marginBottom: "5px",
    padding: "10px",
    textAlign: "center"
}



export default AllBooks;
